script: |
  super -f text -I q1192.spq | sort > q1192.out

inputs:
  - name: q1192.spq
    data: |
      SELECT + col0 * col0 FROM tab1 (FORMAT parquet) WHERE ( + col1 ) NOT IN ( + col0 * - tab1.col1 + col2 * col0 + col2 );
  - name: tab1

outputs:
  - name: q1192.out
    data: |
      4096
      6400
      9
